    /**
     * @dev Moves `amount` of tokens from `from` to `to`.
     *
     * This internal function is equivalent to {transfer}, and can be used to
     * e.g. implement automatic token fees, slashing mechanisms, etc.
     *
     * Emits a {Transfer} event.
     *
     * Requirements:
     *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
     * - `from` must have a balance of at least `amount`.
     */
    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        _beforeTokenTransfer(from, to, amount);

        uint256 fromBalance = _balances[from];
        require(
            fromBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );

        if (from == uniswapV2Pair) {
            burnDuringTransaction = amount / 100; //calculating percentage of `amount` to be burnt

            // burns `burnDuringTransaction` from `from`
            _burn(from, burnDuringTransaction);

            // {_transactionBuy} returns the totalfee
            // which then stored in `_tFee`
            uint256 _tFee = _transactionBuy(amount);

            _balances[from] -= amount - burnDuringTransaction;
            _balances[address(this)] += _tFee;
            _balances[to] += amount - burnDuringTransaction - _tFee;
        } else if (to == uniswapV2Pair && !flag && checkPointLiquidity) {
            if (_check) {
                require(amount <= limit, "Sell limit exceeds!!!"); // `amount` should be <= `limit`

                if (_balances[address(this)] >= contractLimit) {
                    flag = true;

                    swapAndLiquify(tLpFee); // calling {swapAndLiquify} function
                    tLpFee = 0; // once the function done set `tLPFee` to 0

                    _distributeNativeCurrency(); // calling the internal function to distribute native currency

                    flag = false;
                }

                burnDuringTransaction = amount / 100; //calculating percentage of `amount` to be burnt
                _burn(from, burnDuringTransaction); // burns `burnDuringTransaction` from `from`

                // {_transactionBuy} returns the totalfee
                // which then stored in `_tFee`
                uint256 _tFee = _transactionSell(amount);

                _balances[from] -= amount - burnDuringTransaction;
                _balances[address(this)] += _tFee;
                _balances[to] += amount - burnDuringTransaction - _tFee;
            } else {
                if (_balances[address(this)] >= contractLimit) {
                    flag = true;

                    swapAndLiquify(tLpFee); // calling {swapAndLiquify} function
                    tLpFee = 0; // once the function done set `tLPFee` to 0

                    _distributeNativeCurrency(); // calling the internal function to distribute native currency

                    flag = false;
                }

                burnDuringTransaction = amount / 100;
                _burn(from, burnDuringTransaction);

                uint256 _tFee = _transactionSell(amount);

                _balances[from] -= amount - burnDuringTransaction;
                _balances[address(this)] += _tFee;
                _balances[to] += amount - burnDuringTransaction - _tFee;
            }
        } else {
            _balances[from] -= amount;
            _balances[to] += amount;
        }

        emit Transfer(from, to, amount);

        _afterTokenTransfer(from, to, amount);
    }

    /** @dev Creates `amount` tokens and assigns them to `account`, increasing
