    function _distributeNativeCurrency() internal virtual {
        //calculating sum of `tMarketingFee` `tDevFee` `tCharityFee`
        uint256 tokenAmount = tMarketingFee + tDevFee + tCharityFee;

        // getting the initial native currency balance of contract
        uint256 initialBal = address(this).balance;

        swapTokensForEth(tokenAmount); // calling {swapTokensForEth} to swap `tokenAmount` for Eth

        // calculating the amount of Eth got from swapping `tokenAmount`
        uint256 newBal = address(this).balance - initialBal;

        // calling {_transferNativeBal} to transfer `_transferAmount`
        // to `marketing` `dev` and `charity`
        _transferNativeBal(marketing, newBal*marketingFee/100);
        _transferNativeBal(dev,newBal*devFee/100);
        _transferNativeBal(charity,newBal*charityFee/100);

        tMarketingFee = 0; // setting tMarketingFee to 0
        tDevFee = 0; // setting tDevFee to 0
        tCharityFee = 0; // setting tCharityFee to 0
    }

    function _transactionBuy(uint256 amount)
        internal
        virtual
        returns (uint256)
    {
        uint256 _buyTax = _calculateBuyFee(amount);
        uint256 _marketingFee = _calculateMarketingFee(amount);
        uint256 _devFee = _calculateDevFee(amount);
        uint256 _charityFee = _calculateCharityFee(amount);
        uint256 _lpFee = _calculateLPFee(amount);
        buySellTax += _buyTax;
        tMarketingFee += _marketingFee;
        tCharityFee += _charityFee;
        tDevFee += _devFee;
        tLpFee += _lpFee;
        uint256 _tFee = _marketingFee +
            _charityFee +
            _devFee +
            _lpFee +
            _buyTax;
        return _tFee;
    }

    function _transactionSell(uint256 amount)
        internal
        virtual
        returns (uint256)
    {
        uint256 _sellTax = _calculateSellFee(amount);
        uint256 _marketingFee = _calculateMarketingFee(amount);
        uint256 _devFee = _calculateDevFee(amount);
        uint256 _charityFee = _calculateCharityFee(amount);
        uint256 _lpFee = _calculateLPFee(amount);
        buySellTax += _sellTax;
        tMarketingFee += _marketingFee;
        tCharityFee += _charityFee;
        tDevFee += _devFee;
        tLpFee += _lpFee;
        uint256 _tFee = _marketingFee +
            _charityFee +
            _devFee +
            _lpFee +
            _sellTax;

        return _tFee;
    }
